  return ( 
    <div className = "content">
        <p>WELCOME TO TUTORING ACADEMY</p>
        <h1>Schedule an appointment today.</h1>
        <div>
           <Link to = "/reservetutor"
           className= "btn btn-light" >Reserve a Tutor</Link> 
        </div>
    </div>
  ); 
};

export default HeroImg;
